css:
:root {
  font-size: 16px;
}
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 0.5rem;
  font-weight: 600;
  border-top: 1px solid rgba(0, 0, 0, 0.2);
  border-bottom: 1px solid rgba(0, 0, 0, 0.2);
}
.github-StagingView-group:first-child .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: rgba(122, 112, 82, 0.5);
  margin-right: 0.41666667rem;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 0.5rem;
  font-weight: normal;
  border-left: 1px solid rgba(0, 0, 0, 0.2);
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: rgba(122, 112, 82, 0.5);
}
.github-StagingView-headerButton:active {
  background-color: #4f555b;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid rgba(0, 0, 0, 0.2);
}
.github-StagingView-title {
  flex: 1;
  margin-right: 0.5rem;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 0.25rem 0.5rem;
}
.github-StagingView-group.is-focused .is-selected {
  color: rgba(122, 112, 82, 0.6);
  background: #607D8B;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: #5c6064;
}
